The defendant is sentenced to the Wisconsin State Prison System for a total of fifty-four (54) months.  That is eighteen (18) months initial confinement followed by thirty-six (36) months extended supervision.
The Court finds the defendant eligible for both the Challenge Incarceration Program and the Substance Abuse Program.
Conditions of extended supervision:
1) Pay court costs;
2) pay supervision fees in an amount to be determined by DOC;
3) AODA assessment and follow through;
4) Maintain absolute sobriety;
5) No possession of alcohol or drugs not legally prescribed, or drug paraphernalia;
6) No ownership, possession or use of any weapons;
7) Undergo parenting/fatherhood classes;
8) No contact with Michael Taylor or any known drug dealers or users;
9) Obtain GED or HSED.
The defendant has credit for 14 days.
$7,500.00 cash bail applied to court costs of $518.00.  Balance is to be returned to LaShunn P. Qaasim.
